import React, { useEffect, useState } from 'react';
import axios from 'axios';
import './styles/DashboardPage.css'; // Importamos el archivo de estilos CSS

function DashboardPage() {
  const [users, setUsers] = useState([]);
  const [newUser, setNewUser] = useState({ username: '', password: '' });
  const [editUser, setEditUser] = useState({ id: null, username: '', password: '' });

  const fetchUsers = async () => {
    try {
      const response = await axios.get('http://localhost:4000/users');
      setUsers(response.data);
    } catch (error) {
      console.error('Error fetching users:', error);
    }
  };

  const handleAddUser = async () => {
    try {
      await axios.post('http://localhost:4000/users', newUser);
      alert('Usuario agregado correctamente');
      fetchUsers();
      setNewUser({ username: '', password: '' });
    } catch (error) {
      alert('Error al agregar usuario');
    }
  };

  const handleDelete = async (id) => {
    try {
      await axios.delete(`http://localhost:4000/users/${id}`);
      alert('Usuario eliminado correctamente');
      fetchUsers();
    } catch (error) {
      alert('Error al eliminar usuario');
    }
  };

  const handleEditUser = (user) => {
    setEditUser({ id: user.id, username: user.username, password: user.password });
  };

  const handleUpdateUser = async () => {
    try {
      await axios.patch(`http://localhost:4000/users/${editUser.id}`, editUser);
      alert('Usuario actualizado correctamente');
      fetchUsers();
      setEditUser({ id: null, username: '', password: '' });
    } catch (error) {
      alert('Error al actualizar tu usuario');
    }
  };

  useEffect(() => {
    fetchUsers();
  }, []);

  return (
    <div className="dashboard-container"> {/* Usamos una clase personalizada para el contenedor */}
      <div className="dashboard-card">
        <h1 className="dashboard-title">Mi Dashboard Personalizado</h1>
        <div className="form-container">
          <input
            type="text"
            placeholder="Nombre de usuario"
            value={newUser.username}
            onChange={(e) => setNewUser({ ...newUser, username: e.target.value })}
            className="input-field"
          />
          <input
            type="password"
            placeholder="Contraseña"
            value={newUser.password}
            onChange={(e) => setNewUser({ ...newUser, password: e.target.value })}
            className="input-field"
          />
          <button onClick={handleAddUser} className="action-button">
            Agregar Usuario
          </button>
        </div>
        <table className="user-table">
          <thead>
            <tr>
              <th>Usuario</th>
              <th>Contraseña</th>
              <th>Fecha de creación</th>
              <th>Acciones</th>
            </tr>
          </thead>
          <tbody>
            {users.map((user) => (
              <tr key={user.id}>
                <td>{user.username}</td>
                <td>{user.password}</td>
                <td>{user.createdAT}</td>
                <td>
                  <button onClick={() => handleDelete(user.id)} className="delete-button">
                    Eliminar
                  </button>
                  <button onClick={() => handleEditUser(user)} className="edit-button">
                    Editar
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
        {editUser.id !== null && (
          <div className="edit-form">
            <h2>Editar Usuario</h2>
            <input
              type="text"
              placeholder="Nombre de usuario"
              value={editUser.username}
              onChange={(e) => setEditUser({ ...editUser, username: e.target.value })}
              className="input-field"
            />
            <input
              type="password"
              placeholder="Contraseña"
              value={editUser.password}
              onChange={(e) => setEditUser({ ...editUser, password: e.target.value })}
              className="input-field"
            />
            <button onClick={handleUpdateUser} className="update-button">
              Actualizar Usuario
            </button>
          </div>
        )}
      </div>
    </div>
  );
}

export default DashboardPage;
